import React from "react";
import style from "./navebar.module.css";
import logo from "../../assets/imgs/images-removebg-preview.png";
const NaveBar = () => {
  return (
    <div className={style.navebar + " center"}>
      <div className="container center">
        <div className={style.logo}>
          <img alt="To_Do_List_Logo" />
        </div>
        <div className={style.lnks}>
          <ul className="center justify-content-end">
            <li>
              <a href="/">Home</a>
            </li>
            <li>
              <a href="/">about</a>
            </li>
            <li>
              <a href="/">Concet</a>
            </li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default NaveBar;
